description:
20 in the Med

Sociopolitical Documentary hosted by Anna Mhoireach, published by BBC broadcasted as part of BBC Soillse series in 2013 - English narration


Information
------------------------------

Being 20 in Israel often means taking weapons to be patriotic. In Egypt at that age, a feeling of nationalism is discovered. When you're 20 in Albania, you hope to belong to the European Union one day. Whether they're Turkish, Spanish or Italian, a whole world separates these young people living on the shores of the Mediterranean.

